/* ==UserStyle==
@name           Dark Instagram++
@namespace      USO Archive
@author         Justin Ikeako
@description    `<strong>Hey 👋🏽</strong>Dark Instagram++ is literally as the title says, a dark mode for the website Instagram lol. More features coming soon for sure. Feel free to suggest a change or give feedback. Both are really appreciated.Made with 💖by <a href="https://userstyles.org/users/709142">Justin Ikeako</a>`
@version        2020615.6.23
@license        NO-REDISTRIBUTION
@preprocessor   uso
@advanced dropdown comments "Remove Comments" {
	off "Off*" <<<EOT  EOT;
on "On" <<<EOT /* Hide comments *\/
.L_LMM.ePUX4 .k59kT .ZyFrc:not(:first-child),
.L_LMM.ePUX4 .k59kT .lnrre,
.-V_eO:nth-child(2),
.XQXOT .Mr508 {
	display: none;
}








 EOT;

}
@advanced dropdown scroll "Scroll Bar" {
	on "On*" <<<EOT /* Scrollbar *\/
body::-webkit-scrollbar {
	width: 15px !important;
	height: 15px !important;
	display: block !important;
	background: #141414 !important;
	background-image: url(data:image/svg+xml;base64,), url(data:image/svg+xml;base64,) !important;
	background-position: top center, bottom center !important;
	background-size: contain !important;
	background-repeat: no-repeat !important;
}

/* Thumb *\/
body::-webkit-scrollbar-thumb {
	background: #fff4 !important;
	border-left: 2px solid !important;
	border-right: 2px solid !important;
	border-color: #141414 !important;
}

body::-webkit-scrollbar-thumb:hover {
	background: #fff5 !important;
}

[dark] body::-webkit-scrollbar-thumb:active {
	background: #fff6 !important;
}

/* Buttons *\/
body::-webkit-scrollbar-button:single-button {
	background-position: center center;
	background-size: contain;
  display: block;
  height: 16px;
  width: 16px;
	background: #14141488;
}

body::-webkit-scrollbar-button:single-button:hover {
	background: #14141444;
}

[dark] body::-webkit-scrollbar-button:single-button:active {
	background: #14141422;
}

 EOT;
off "Off" <<<EOT ::-webkit-scrollbar {
	display: none
}








 EOT;

}

==/UserStyle== */
