@description    `<b>PLEASE TURN THE NEW FACEBOOK DARK MODE ON, THANKS</b><b>Works with old and new layout</b>When the night has come, and the land is dark, and the moon is the only light... Keep your eyes healthy with the best facebook dark theme ever!</br>Full Theme (personal profile, business page, chat, messenger, marketplace, events, calendar, video player, stories...)<b>messenger.com and facebook.onion supported! Social plugins/widgets excluded!</b>Feel free to tell me if you see any problems, I'll try to fix them quickly!<b>For colored icons (only with the old layout), use the "Customize Settings" button, thanks.</b>`
